    false,nt"url": null,nt"notes": "As the official handbook of the Federal
    Government, the United States Government Manual provides comprehensive information
    on the agencies of the legislative, judicial, and executive branches. It also includes
    information on quasi-official agencies; international organizations in which the
    United States participates; and boards, commissions, and committees. The Manual
    begins with reprints of the Declaration of Independence and the U.S. Constitution.
    A typical agency description includes a list of officials heading major operating
    units, a summary statement of the agency's purpose and role in the Federal Government,
    a brief history of the agency, including its legislative or executive authority,
    and a description of its programs and activities, and information, addresses, and
    phone numbers to help users locate detailed information on consumer activities,
    contracts and grants, employment, publications, and other matters of public interest.",nt"license_title":
